(26, 'दुबलेपन से परेशान है तो करे ये आसान उपाय', '<p><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"font-size: 16px;\">जैसा की आप सबको पता है दुबले-पतले तथा कमजोर शरीर वाले पुरुष/युवा फिट तथा तंदुरुस्त पुरुष की तुलना में जल्दी थक जाते है। तो ऐसे में जरूरी है की फिट तथा तंदुरुस्त रहा जाय पर सवाल ये है की कैसे? क्या ज्यादा खाना या विटामिन्स की गोलियां खा लेने से वजन बढ़ जायेगा ! दरअसल उम्र के हिसाब से वजन का एक मापदंड होता है अगर आपका उम्र के हिसाब से वजन कम है तो आप दुर्बल ब्यक्ति की श्रेणी में आएंगे। उम्र के साथ वजन ना बढ़ने के कई कारण हो सकते है तो आइये जानते है वजन न बढ़ने के कारण।</span></span></p>', 5, 8, 'asp-101', 'ASP 101', '1640284200/FkQDGwK5fJiKZBiakwFqkpcUWivaIHdFKvmQ1vfy.jpg', 'https://www.arayurveda.com/products/ashwashakti-powder', 0, NULL, NULL, NULL, NULL, 1, '2022-01-21 09:57:22', '2022-01-21 09:58:59'),
